sys_variable_value.value:
(function execute(inputs, outputs) {
 inputs = new sn_fb_wp_spoke.FacebookWorkplaceUtils().trimStringInputs(inputs);
  outputs.user_id = "";
  if(inputs.status_code == '200') {
  var data = JSON.parse(inputs.response);
	for(i=0; i<data.Resources.length; i++) {
    	if(data.Resources[i].userName == inputs.email)
        	outputs.user_id = data.Resources[i].id.toString();      
    }

      if(!outputs.user_id) {
  		inputs.response = "User does not exist.";
   		outputs = new sn_fb_wp_spoke.FacebookWorkplaceErrorHandler().userErrorHandler(inputs,outputs);
  		} else if (outputs.user_id)
  			outputs.status = 'Success';

  } else
  	outputs = new sn_fb_wp_spoke.FacebookWorkplaceErrorHandler().userErrorHandler(inputs, outputs);

})(inputs, outputs);

